import * as S from "../styles/Register.style";

function Register() {
  return (
    <S.Container>
      <S.RegisterWindow>
        프로필 등록<br />
        이름:<br />
        나이:<br />
        성별:<br />
        키:<br />
        몸무게:<br />
      </S.RegisterWindow>
    </S.Container>
  )
}

export default Register;
